Defendant Corvelle T Williams in court with attorney Jane Heather Christopherson.  Defendant Corvelle T Williams in custody.  Deann L. Heard appeared for the State of Wisconsin.  Sentencing proceeded.  Statements by the State, defense and defendant.   The Court imposed the following sentence:

Defendant's TOTAL LENGTH OF SENTENCE shall be 3 years, consecutive to any other sentence.  Defendant's TERM OF CONFINEMENT in the Wisconsin Prison System shall be for 18 months; credit to be taken in revocation case (192 days time served).  Defendant shall serve 18 months on EXTENDED SUPERVISION.  The defendant IS eligible for the Challenge Incarceration Program, but not for the Wisconsin Substance Abuse Program.  The Court advised the defendant of his determinate sentence pursuant to statute and in accordance with Form CR-234.  Copy provided to defendant. 
 * Court ordered defendant to provide a DNA sample, if one has not been previously provided.
 * Court ordered defendant to pay the DNA surcharge, plus costs and disbursements from prison funds not to exceed 25%.
 * Court ordered defendant to have no contact with Remi Williams and must be kept separate from him in prison.

CONDITIONS OF EXTENDED SUPERVISION:
 - No controlled substances or alcohol;
 - Urine screens;
 - AODA assessment; treatment if necessary;
 - No contact with the victim B.A.M., d/o/b: 3/08/1997;
 - Cognitive thinking intervention counseling;
 - Seek and maintain employment;
 - Seek and maintain no contact;
 - No contact with Remi Williams;
 - Pay the balances remaining of the DNA surcharge, costs and disbursements and supervision fees.  Failure to pay would result in a civil judgment entered against defendant which is non-dischargeable in bankruptcy.

